/* basics *****************************************************************************************/


/** Concatenates two tokens. */
#define PP_CAT(x, ...) PP_CAT_HELPER1(x, __VA_ARGS__)
#define PP_CAT_HELPER1(x, ...) PP_CAT_HELPER2(x, __VA_ARGS__)
#define PP_CAT_HELPER2(x, ...) x ## __VA_ARGS__


/** Returns a single comma. */
#define PP_COMMA(...) ,


/** Returns the given element. */
#define PP_ELEM(x) x


/** Returns the given arguments. */
#define PP_EXPAND(...) __VA_ARGS__


/** Returns nothing. */
#define PP_NULL(...)


/** Dereference macro expansion. */
#define PP_DEFER(...) __VA_ARGS__ PP_NULL()
#define PP_OBSTRUCT(...) __VA_ARGS__ PP_DEFER(PP_NULL)()


/** Forces 256 additional preprocessor scans to evaluate recursive expressions for example. */
#define PP_EVAL(...)         PP_EVAL_HELPER1(PP_EVAL_HELPER1(__VA_ARGS__))
#define PP_EVAL_HELPER1(...) PP_EVAL_HELPER2(PP_EVAL_HELPER2(__VA_ARGS__))
#define PP_EVAL_HELPER2(...) PP_EVAL_HELPER3(PP_EVAL_HELPER3(__VA_ARGS__))
#define PP_EVAL_HELPER3(...) PP_EVAL_HELPER4(PP_EVAL_HELPER4(__VA_ARGS__))
#define PP_EVAL_HELPER4(...) PP_EVAL_HELPER5(PP_EVAL_HELPER5(__VA_ARGS__))
#define PP_EVAL_HELPER5(...) PP_EVAL_HELPER6(PP_EVAL_HELPER6(__VA_ARGS__))
#define PP_EVAL_HELPER6(...) PP_EVAL_HELPER7(PP_EVAL_HELPER7(__VA_ARGS__))
#define PP_EVAL_HELPER7(...) PP_EVAL_HELPER8(PP_EVAL_HELPER8(__VA_ARGS__))
#define PP_EVAL_HELPER8(...) __VA_ARGS__


/**
 * @doccopy PP_EVAL
 * @remarks Used to implement 2nd level sequence counting.
 */
#define PP_EVAL2(...)         PP_EVAL2_HELPER1(PP_EVAL2_HELPER1(__VA_ARGS__))
#define PP_EVAL2_HELPER1(...) PP_EVAL2_HELPER2(PP_EVAL2_HELPER2(__VA_ARGS__))
#define PP_EVAL2_HELPER2(...) PP_EVAL2_HELPER3(PP_EVAL2_HELPER3(__VA_ARGS__))
#define PP_EVAL2_HELPER3(...) PP_EVAL2_HELPER4(PP_EVAL2_HELPER4(__VA_ARGS__))
#define PP_EVAL2_HELPER4(...) PP_EVAL2_HELPER5(PP_EVAL2_HELPER5(__VA_ARGS__))
#define PP_EVAL2_HELPER5(...) PP_EVAL2_HELPER6(PP_EVAL2_HELPER6(__VA_ARGS__))
#define PP_EVAL2_HELPER6(...) PP_EVAL2_HELPER7(PP_EVAL2_HELPER7(__VA_ARGS__))
#define PP_EVAL2_HELPER7(...) PP_EVAL2_HELPER8(PP_EVAL2_HELPER8(__VA_ARGS__))
#define PP_EVAL2_HELPER8(...) __VA_ARGS__


/** Returns a char[] literal of the given argument. */
#define PP_TOSTR(x) #x


/* logic ******************************************************************************************/


/** Returns the second argument. */
#define PP_CHECK_N(x, n, ...) n


/** Helper macro to perform a logical check. */
#define PP_CHECK(...) PP_CHECK_N(__VA_ARGS__, 0,)
#define PP_CHECK_PROBE(x) x, 1, 


#define PP_IS_PAREN(x) PP_CHECK(PP_IS_PARENT_HELPER x)
#define PP_IS_PARENT_HELPER(...) PP_CHECK_PROBE(~)


/** Logical NOT for the given boolean values (0 or 1). */
#define PP_BITNOT(x) PP_CAT(PP_BITNOT_, x)
#define PP_BITNOT_0 1
#define PP_BITNOT_1 0


/** Checks if the given value is not 0. */
#define PP_NOT(x) PP_CHECK(PP_CAT(PP_NOT_, x))
#define PP_NOT_0 ~, 1,


/** Inverts the given boolean value (0 or 1). */
#define PP_COMPL(b) PP_CAT(PP_COMPL_, b)
#define PP_COMPL_0 1
#define PP_COMPL_1 0


/** Forces late macro expansion to transform the given value into a boolean value (0 or 1). */
#define PP_BOOL(x) PP_COMPL(PP_NOT(x))


/** Logical AND for the given boolean values (0 or 1). */
#define PP_BITAND(lhs, rhs) PP_CAT(PP_CAT(PP_CAT(PP_BITAND_, lhs), _), rhs)
#define PP_BITAND_0_0 0
#define PP_BITAND_0_1 0
#define PP_BITAND_1_0 0
#define PP_BITAND_1_1 1


/** Logical AND for the given boolean values. Performs implicit boolean conversion. */
#define PP_AND(lhs, rhs) PP_BITAND(PP_BOOL(lhs), PP_BOOL(rhs))


/** Logical OR for the given boolean values (0 or 1). */
#define PP_BITOR(lhs, rhs) PP_CAT(PP_CAT(PP_CAT(PP_BITOR_, lhs), _), rhs)
#define PP_BITOR_0_0 0
#define PP_BITOR_0_1 1
#define PP_BITOR_1_0 1
#define PP_BITOR_1_1 1


/** Logical OR for the given boolean values. Performs implicit boolean conversion. */
#define PP_OR(lhs, rhs) PP_BITOR(PP_BOOL(lhs), PP_BOOL(rhs))


/** Logical XOR for the given boolean values (0 or 1). */
#define PP_BITXOR(lhs, rhs) PP_CAT(PP_CAT(PP_CAT(PP_BITXOR_, lhs), _), rhs)
#define PP_BITXOR_0_0 0
#define PP_BITXOR_0_1 1
#define PP_BITXOR_1_0 1
#define PP_BITXOR_1_1 0


/** Logical XOR for the given boolean values. Performs implicit boolean conversion. */
#define PP_XOR(lhs, rhs) PP_BITXOR(PP_BOOL(lhs), PP_BOOL(rhs))


/** Logical BICONDITIONAL for the given boolean values (0 or 1). */
#define PP_BITBICON(lhs, rhs) PP_CAT(PP_CAT(PP_CAT(PP_BITBICON_, lhs), _), rhs)
#define PP_BITBICON_0_0 1
#define PP_BITBICON_0_1 0
#define PP_BITBICON_1_0 0
#define PP_BITBICON_1_1 1


/** Logical BICONDITIONAL for the given boolean values. Performs implicit boolean conversion. */
#define PP_BICON(lhs, rhs) PP_BITBICON(PP_BOOL(lhs), PP_BOOL(rhs))


/**
 * Checks if the condition is true. Returns a macro which evaluates to the
 * first argument if the condition was true or to all other arguments else.
 */
#define PP_IIF(c) PP_CAT(PP_IIF_, c)
#define PP_IIF_0(t, ...) __VA_ARGS__
#define PP_IIF_1(t, ...) t


/**
 * Checks if the condition is true. Returns a macro which evaluates to the
 * first argument if the condition was true or to all other arguments else.
 * Additionally, converts the given condition into a boolean value so that
 * it can be used with PP_IIF().
 */
#define PP_IF(c) PP_IIF(PP_BOOL(c))


/** Returns 1 if a argument was given or 0 else. */
#define PP_NOT_EMPTY(x) \
	PP_IF(PP_NOT_EMPTY_HELPER1(x)) \
	(1, PP_BOOL(PP_NOT_EMPTY_HELPER3 x ()))
/* Special handling for parentheses is needed here. */
#define PP_NOT_EMPTY_HELPER1(x) PP_CHECK(PP_NOT_EMPTY_HELPER2 x)
#define PP_NOT_EMPTY_HELPER2(...) x, 1,
#define PP_NOT_EMPTY_HELPER3() 0
	

/**
 * Returns a macro which evaluates to its given argument if the condition
 * true (not 0) or to nothing else.
 */
#define PP_WHEN(c) PP_IF(c)(PP_EXPAND, PP_NULL)


/**
 * Checks if a comparator macro was defined for the given macro. This is needed
 * to make the token comparable using PP_EQUAL and PP_NOT_EQUAL.
 * Comparer macros need to be defined as:
 * @code
 * #define COMPARE_<token>(x) x
 * @endcode
 */
#define PP_IS_COMPARABLE(x) PP_IS_PAREN(PP_CAT(COMPARE_, x)(()))


/**
 * Tests if the given tokens are not equal.
 * @see PP_IS_COMPARABLE()
 */
#define PP_NOT_EQUAL(lhs, rhs) \
	PP_IIF(PP_BITAND(PP_IS_COMPARABLE(lhs), PP_IS_COMPARABLE(rhs)))( \
		PP_NOT_EQUAL_HELPER, \
		1 PP_NULL \
	)(lhs, rhs)
#define PP_NOT_EQUAL_HELPER(lhs, rhs) PP_IS_PAREN( \
		PP_CAT(COMPARE_, lhs)(PP_CAT(COMPARE_, rhs))(()) \
	)


/**
 * Tests if the given tokens are equal.
 * @see PP_IS_COMPARABLE()
 */
#define PP_EQUAL(lhs, rhs) PP_COMPL(PP_NOT_EQUAL(lhs, rhs))


