/** Repeats the given argument n times. Supports numbers up to the maximum of PP_DEC(). */
#define PP_REPEAT(n, x) PP_EVAL(PP_REPEAT_HELPER1(n, x))
#define PP_REPEAT_HELPER1(n, x) \
